import "../styles/clubs.css";

function Clubs() {
  useEffect(() => {
    fetch('http://127.0.0.1:5000/clubs')
      .then(response => response.json())
      .then(data => console.log('Success:', data))
      .catch(error => console.error('Error:', error));
  }, []);

  return (
    <div>
